import React from 'react';
import { Link } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

import '../assets/css/pn-style.css';


function Color() {
    const location = useLocation();
    let loc = location.pathname;
    if (loc === "/patagonia") {
        return (
            <>
                <div>
                    <nav className = "navbar">
                        <li id = "proj">
                            <Link class = "purple" to = "/patagonia">Patagonia</Link>
                        </li>

                        <li>
                            <Link class = "purple" to = "/BI-design-challenges">BI Design Challenge</Link>
                        </li>

                        <li>
                            <Link class = "purple" to = "/Retro-arcade">Retro Arcade</Link>
                        </li>

                        <li>
                            <Link class = "purple" to = "/BYOW">BYOW</Link>
                        </li>

                        <li>
                            <Link class = "purple" to = "/Kingpin-donut">KingPin Donut</Link>
                        </li>
                    </nav>
                </div>

            </>
        );
    } 
    return (
        <>
        </>
    );
}

const ProjectNav = () => (
    <>
        <Color />
    </>
);

export default ProjectNav;
